 Matomo Mobile. Chúng tôi sẽ không theo dõi bất kỳ dữ liệu phân tích nào của bạn. Dữ liệu ẩn danh này sẽ không bao giờ được công khai. Bạn có thể tắt/bật theo dõi ẩn danh trong cài đặt bất cứ lúc nào.";s:17:"ChooseHttpTimeout";s:30:"Chọn giá trị HTTP timeout";s:12:"ChooseMetric";s:18:"Chọn số liệu";s:12:"ChooseReport";s:22:"Chọn một báo cáo";s:13:"ChooseSegment";s:12:"Chọn khung";s:20:"ConfirmRemoveAccount";s:52:"Bạn có muốn xóa bỏ tài khoản này không?";s:17:"DefaultReportDate";s:15:"Ngày báo cáo";s:7:"EmailUs";s:26:"Gửi mail cho chúng tôi";s:17:"EnableGraphsLabel";s:29:"Hiển thị các đồ thị";s:14:"EvolutionGraph";s:24:"Biểu đồ sự kiện";s:26:"HelpUsToImprovePiwikMobile";s:93:"Bạn có muốn cho phép theo dõi việc sử dụng ẩn danh trong Matomo Mobile không?";s:20:"HowtoDeleteAnAccount";s:49:"Nhấn lâu để loại bỏ một tài khoản.";s:25:"HowtoDeleteAnAccountOniOS";s:61:"Trượt sang phải sang trái để xóa một tài khoản";s:19:"HowtoLoginAnonymous";s:86:"Để lại tên người dùng và mật khẩu trống để đăng nhập ẩn danh";s:22:"HttpIsNotSecureWarning";s:277:"Mã thông báo ủy quyền Matomo của bạn (token_auth) đã được gửi trong văn bản minh bạch nếu bạn sử dụng \'HTTP\'. Vì lý do này, chúng tôi đề nghị HTTPS vận chuyển an toàn dữ liệu qua internet. Bạn có muốn tiếp tục không?";s:11:"HttpTimeout";s:12:"HTTP Timeout";s:14:"IgnoreSslError";s:18:"Bỏ qua lỗi SSL";s:24:"IncompatiblePiwikVersion";s:184:"Phiên bản Matomo bạn đang sử dụng không tương thích với Matomo Mobile 2. Cập nhật cài đặt Matomo của bạn và thử lại hoặc cài đặt Matomo Mobile 1.";s:11:"LastUpdated";s:23:"Cập nhật cuối: %s";s:13:"LoadingReport";s:14:"Đang tải %s";s:16:"LoginCredentials";s:25:"Thông tin giới thiệu";s:28:"LoginToPiwikToChangeSettings";s:195:"Đăng nhập vào máy chủ Matomo của bạn để tạo và cập nhật các trang web, người dùng hoặc thay đổi các thiết lập chung như "Báo cáo tải theo mặc định".";s:13:"LoginUseHttps";s:17:"Sử dụng https";s:12:"MatomoMobile";s:30:"Ứng dụng di động Matomo";s:15:"MultiChartLabel";s:23:"Hiển thị