một lần truy cập, nó chỉ được tính một lần.";s:21:"ColumnUniqueDownloads";s:29:"Lượt tải về duy nhất";s:20:"ColumnUniqueOutlinks";s:26:"Đường link bên ngoài";s:28:"DownloadsReportDocumentation";s:289:"Trong báo cáo này, bạn có thể thấy những file nào khách truy cập đã download. %s Cái gì mà Matomo tính như một tải về là một click trên một liên kết tải về. Cho dù tải về đã được hoàn thành hoặc không được biết đến Matomo.";s:15:"EntryPageTitles";s:31:"Tiêu đề trang khởi đầu";s:34:"EntryPageTitlesReportDocumentation";s:142:"Báo cáo này chứa thông tin về các tiêu đề của các trang đến đã được sử dụng trong một thời hạn quy định.";s:14:"ExitPageTitles";s:27:"Tiêu đề trang rời đi";s:33:"ExitPageTitlesReportDocumentation";s:151:"Báo cáo này có chứa thông tin về những tiêu đề của những trang thoát xuất hiện trong một khoảng thời gian nhất định.";s:9:"OneSearch";s:19:"1 lần tìm kiếm";s:20:"OutlinkDocumentation";s:115:"Một outlink là một liên kết dẫn người truy cập từ trang web của bạn (đến tên miền khác)";s:27:"OutlinksReportDocumentation";s:128:"Báo cáo này cho thấy một danh sách phân cấp của outlink URL đã được click bởi khách truy cập của bạn";s:24:"PagesReportDocumentation";s:194:"Báo cáo này chứa thông tin về các URLs của trang đã được xem. %s Bảng này được tổ chức dưới dạng cây, Các URL được hiển thị dưới cấu trúc folder.";s:29:"PageTitlesReportDocumentation";s:223:"Báo cáo này chứa thông tin về tiêu đề các trang đã được truy cập. %1$s Tiêu đề trang là thẻ HTML %2$s mà các trình duyệt hiển thị trên thanh tiêu đề của cửa sổ trình duyệt.";s:8:"PageUrls";s:21:"Đường dẫn trang";s:17:"PluginDescription";s:266:"Các báo cáo về lượt xem trang và tiêu đề trang. Cho phép bạn đo lường công cụ tìm kiếm của trang web nội bộ của bạn. Tự động theo dõi các lượt nhấp chuột vào liên kết bên ngoài và lượt tải về tập tin.";s:21:"SiteSearchCategories1";s:149:"Báo cáo này liệt kê các hạng mục cho người truy cập lựa chọn khi họ thực hiện một tìm kiếm trên trang web của bạn";s:21:"SiteSearchCategories2";s:243:"Ví dụ, một trang thương mại điện tử (e-commerce) thường có chức năng "Lựa chọn Phân mục" để khách truy cập giới hạn phạm vi tìm kiếm đối với các sản phẩm trong một phân mục quy định.";s:27:"SiteSearchFollowingPagesDoc";s:422:"Khi khách tìm kiếm trên trang web của bạn, họ tìm kiếm một trang, nội dung, sản phẩm hoặc một dịch vụ cụ thể. Báo cáo này liệt kê các trang đã được click nhiều nhất sau khi thực hiện phép tìm kiếm (nội bộ). Nói cách khác, danh sách này chứa các trang được tìm kiếm nhiều nhất được thực hiện bởi khách trên trang web của bạn.";s:15:"SiteSearchIntro";s:437:"Theo dõi các tìm kiếm mà khách đã thực hiện trên trang web của bạn là một cách hữu hiệu để hiểu hơn về thói quen tìm kiếm của khách hàng, và có thể giúp bạn tìm ra ý tưởng cho nội dung mới, sản phẩm thương mại điện tử mới mà những khách hàng tiềm năng có thể tìm kiếm, và cải thiện trải nghiệm của khách hàng trên trang web của bạn.";s:17:"SiteSearchKeyword";s:30:"Từ khóa (trang tìm kiếm)";s:31:"SiteSearchKeywordsDocumentation";s:155:"Báo cáo này liệt kê các từ khóa tìm kiếm mà người truy cập thực hiện tìm kiếm trên công cụ tìm kiếm nội bộ của bạn";s:39:"SiteSearchKeywordsNoResultDocumentation";s:229:"Báo cáo này liệt kê các từ khóa tìm kiếm không trả lại bất cứ kết quả nào => Có thể cần cải thiện máy tìm kiếm, hoặc có thể do người dùng tìm kiếm thứ chưa có trên website.";s:17:"SubmenuPagesEntry";s:19:"Trang khởi đầu";s:16:"SubmenuPagesExit";s:15:"Trang rời đi";s:17:"SubmenuPageTitles";s:17:"Tiêu đề trang";s:17:"SubmenuSitesearch";s:17:"Trang tìm kiếm";s:21:"WidgetEntryPageTitles";s:29:"Tiêu đề trang đầu vào";s:20:"WidgetExitPageTitles";s:29:"Số tiêu đề trang thoát";s:16:"WidgetPagesEntry";s:19:"Trang khởi đầu";s:15:"WidgetPagesExit";s:15:"Trang rời đi";s:16:"WidgetPageTitles";s:17:"Tiêu đề trang";s:31:"WidgetPageTitlesFollowingSearch";s:43:"Các trang ghé thăm sau trang tìm kiếm";s:29:"WidgetPageUrlsFollowingSearch";s:43:"Các trang ghé thăm sau trang tìm kiếm";s:22:"WidgetSearchCategories";s:27:"Số danh mục tìm kiếm";s:20:"WidgetSearchKeywords";s:33:"Số từ khóa trang tìm kiếm";s:28:"WidgetSearchNoResultKeywords";s:50:"Các từ khóa tìm kiếm không có kết quả";s:10:"ActionType";s:20:"Loại hành động";s:21:"PagesSubcategoryHelp3";s:83:"Sử dụng các biểu tượng cộng và trừ ở bên trái để di chuyển.";}s:11:"Annotations";a:18:{s:17:"AddAnnotationsFor";s:32:"Thêm các chú thích cho %s...";s:16:"AnnotationOnDate";s:28:"Chú thích trên %1$s: %2$s";s:11:"Annotations";s:16:"Các chú thích";s:13:"ClickToDelete";s:33:"Click để xóa chú thích này";s:11:"ClickToEdit";s:34:"Click để sửa chú thích này";s:16:"ClickToEditOrAdd";s:51:"Click để sửa hay thêm một chú thích mới";s:19:"ClickToStarOrUnstar";s:67:"Click để đánh dấu sao hay bỏ đánh dấu chú thích này";s:19:"CreateNewAnnotation";s:32:"Tạo một chú thích mới...";s:19:"EnterAnnotationText";s:30:"Nhập ghi chú của bạn...";s:18:"HideAnnotationsFor";s:31:"Ẩn các chú thích cho %s...";s:8:"IconDesc";s:48:"Xem ghi chú trong giới hạn của ngày này";s:17:"IconDescHideNotes";s:49:"Ẩn ghi chú trong giới hạn của ngày này";s:15:"InlineQuickHelp";s:298:"Bạn có thể tạo chú thích để đánh dấu những sự kiện quan trọng (như là: thời điểm đăng một bài blog mới hoặc thay đổi thiết kế trang web), để ghi nhớ những phân tích dữ liệu hoặc để ghi lại bất cứ gì bạn cho là quan trọng.";s:15:"LoginToAnnotate";s:43:"Đăng nhập để tạo một chú thích";s:13:"NoAnnotations";s:54:"Không có chú thích nào trong phạm vi ngày này";s:17:"PluginDescription";s:422:"Cho phép bạn đính kèm ghi chú vào những ngày khác nhau; đánh dấu những thay đổi đã thực hiện trên trang web của bạn; ghi nhớ những phân tích bạn thực hiện liên quan đến dữ liệu của bạn; và chia sẻ quan điểm của bạn với đồng nghiệp. Việc chú thích sẽ giải thích cho bạn vì sao dữ liệu của bạn đang ở tình trạng hiện tại.";s:21:"ViewAndAddAnnotations";s:44:"Hiện thị và thêm chú thích cho %s...";s:23:"YouCannotModifyThisNote";s:151:"Bạn không thể sửa đổi chú thích này, bởi vì bạn đã không tạo ra nó, bạn cũng không có quyền quản trị trang web này.";}s:8:"Contents";a:7:{s:17:"PluginDescription";s:153:"Chức năng theo dõi nội dung và banner cho phép bạn đánh giá được hiệu quả (lượt xem, click, CTR) của bất kỳ trang web nào.";s:11:"Impressions";s:39:"Lượt hiển thị cho người dùng";s:15:"InteractionRate";s:22:"Tỷ lệ tương tác";s:11:"ContentName";s:15:"Tên nội dung";s:12:"ContentPiece";s:24:"Thành phần nội dung";s:13:"ContentTarget";s:26:"Đối tượng nội dung";s:8:"Contents";s:10:"Nội dung";}s:13:"CoreAdminHome";a:69:{s:14:"Administration";s:12:"Quản trị";s:17:"ArchivingSettings";s:21:"Cấu hình archiving";s:16:"BrandingSettings";s:22:"Thiết lập Branding";s:16:"ClickHereToOptIn";s:40:"Click vào đây để lựa chọn vào";s:17:"ClickHereToOptOut";s:45:"Click vào đây để lựa chọn thoát ra";s:22:"CustomLogoFeedbackInfo";s:271:"Nếu bạn tuỳ chỉnh các biểu tượng Matomo, bạn cũng có thể quan tâm đến việc ẩn liên kết %1$s trong top menu. Để làm như vậy, bạn có thể vô hiệu hóa các plugin Thông tin phản hồi trong trang %2$s Plugins Quản lý %3$s.";s:18:"CustomLogoHelpText";s:149:"Bạn có thể tùy chỉnh các biểu tượng Matomo sẽ được hiển thị trong giao diện người dùng và thư điện tử báo cáo.";s:19:"EmailServerSettings";s:24:"Cấu hình email server";s:13:"FaviconUpload";s:45:"Chọn một biểu tượng để tải lên";s:18:"FileUploadDisabled";s:220:"Tải lên các tệp không được kích hoạt trong cấu hình PHP của bạn. Để tải lên logo tùy chỉnh của bạn, vui lòng đặt %s trong php.ini và khởi động lại máy chủ web của bạn.";s:18:"ForBetaTestersOnly";s:46:"Chỉ áp dụng cho thử nghiệm bản beta";s:13:"ImageTracking";s:28:"Theo dõi bằng hình ảnh";s:19:"ImageTrackingIntro1";s:216:"Khi một người truy cập đã bị vô hiệu hóa JavaScript, hoặc khi JavaScript không thể được sử dụng, bạn có thể sử dụng một liên kết theo dõi hình ảnh để theo dõi khách.";s:19:"ImageTrackingIntro2";s:206:"Sinh đường dẫn dưới đây và sao chép-dán mã HTML đã được sinh vào trang. Nếu bạn muốn rút đoạn mã khỏi JavaScript tracking, bạn có thể bao nó lại bằng thẻ %1$s.";s:19:"ImageTrackingIntro3";s:159:"Cho toàn bộ danh sách các tùy chọn, bạn có thể sử dụng với một liên kết theo dõi hình ảnh, xem %1$s Tài liệu theo dõi API %2$s.";s:17:"ImageTrackingLink";s:40:"Liên kết theo dõi bằng hình ảnh";s:19:"ImportingServerLogs";s:28:"Nhập file log của server";s:23:"ImportingServerLogsDesc";s:249:"Một cách khác để theo dõi người truy nhập thông qua trình duyệt (kể cả thông qua Java Script hoặc một link hình ảnh) là phép ghi liên tục vào log nằm trên server. Xem thêm về %1$sServer Log File Analytics%2$s";s:21:"InvalidPluginsWarning";s:84:"Các plugin sau đây không tương thích với %1$s và không thể nạp: %2$s.";s:29:"InvalidPluginsYouCanUninstall";s:112:"Bạn có thể cập nhật hoặc gỡ bỏ cài đặt các plug-in trên trang %1$s Plugins Quản lý %2$s.";s:16:"JSTrackingIntro2";s:158:"Một khi bạn có mã theo dõi JavaScript cho trang web của bạn, sao chép và dán nó vào tất cả các trang bạn muốn theo dõi với Matomo.";s:16:"JSTrackingIntro4";s:157:"Nếu bạn không muốn sử dụng JavaScript để theo dõi khách truy cập, %1$s tạo ra một liên kết theo dõi hình ảnh dưới đây %2$s.";s:16:"JSTrackingIntro5";s:405:"Nếu bạn muốn thực hiện các tác vụ khác theo dõi page view, vui lòng tham khảo %1$sTài liệu Matomo Javascript Tracking%2$s để xem danh sách những chức năng được cung cấp. Sử dụng những chức năng này, bạn có thể theo dõi goals, thông số thiết lập, đơn hàng thương mại điện tử, giỏ hàng bị từ chối và nhiều hơn thế nữa.";s:27:"JSTracking_CampaignKwdParam";s:25:"Chiến dịch từ khóa";s:28:"JSTracking_CampaignNameParam";s:19:"tên chiến dịch";s:35:"JSTracking_CustomCampaignQueryParam";s:84:"Sử dụng tên truy vấn tùy chỉnh cho các tên và từ khóa chiến dịch";s:39:"JSTracking_CustomCampaignQueryParamDesc";s:91:"Lưu ý:.%1$s Matomo sẽ tự động phát hiện các thông số Google Analytics. %2$s";s:25:"JSTracking_DisableCookies";s:43:"Vô hiệu hóa tất cả cookie theo dõi";s:27:"JSTracking_EnableDoNotTrack";s:45:"Cho phép máy khách phát hiện DoNotTrack";s:31:"JSTracking_EnableDoNotTrackDesc";s:113:"Vì vậy, yêu cầu theo dõi sẽ không được gửi nếu người truy cập không muốn bị theo dõi";s:42:"JSTracking_EnableDoNotTrack_AlreadyEnabled";s:115:"Lưu ý: máy chủ hỗ trợ DoNotTrack đã được kích hoạt, tùy chọn này sẽ không có hiệu lực";s:34:"JSTracking_GroupPageTitlesByDomain";s:75:"Thêm vào tên miền trang web ở đầu tiêu đề trang khi theo dõi";s:39:"JSTracking_GroupPageTitlesByDomainDesc1";s:204:"Nếu một người nào đó duyệt trang \'About\' trên blog,%1$s nó sẽ được ghi lại là \'blog/About\'. Đó là cách dễ nhất để xem tổng quan tình hình trên trang web của bạn.";s:23:"JSTracking_MergeAliases";s:83:"Trong báo cáo "Outlinks", ẩn các Click chuột để biết bí danh của URL";s:27:"JSTracking_MergeAliasesDesc";s:123:"Vì vậy, nhấp chuột vào những liên kết trong Alias URL (ví dụ: %s) sẽ không được tính là "Outlink".";s:26:"JSTracking_MergeSubdomains";s:73:"Theo dõi khách truy cập trên tất cả các tên miền phụ của";s:30:"JSTracking_MergeSubdomainsDesc";s:130:"Vì vậy, nếu số lần truy cập là một %1$s và %2$s, chúng sẽ được tính như một khách truy cập duy nhất";s:25:"JSTracking_PageCustomVars";s:61:"Theo dõi một biến tùy chỉnh cho mỗi lần xem trang";s:29:"JSTracking_PageCustomVarsDesc";s:69:"Ví dụ, với biến tên "Category" và giá trị "Sách trắng"";s:28:"JSTracking_VisitorCustomVars";s:57:"Theo dõi biến tuỳ chỉnh cho khách truy cập này";s:32:"JSTracking_VisitorCustomVarsDesc";s:65:"Ví dụ, với tên biến "Type" và giá trị "khách hàng".";s:18:"JavaScriptTracking";s:20:"Theo dõi JavaScript";s:10:"LogoUpload";s:34:"Chọn một logo để tải lên";s:14:"LogoUploadHelp";s:105:"Xin vui lòng tải lên file dưới định dạng %1$s với chiều cao tối thiểu là %2$s pixels";s:15:"MenuDevelopment";s:13:"Phát triển";s:14:"MenuDiagnostic";s:13:"chẩn đoán";s:19:"MenuGeneralSettings";s:17:"cài đặt chung";s:14:"OptOutComplete";s:143:"Việc không tham gia hoàn tất; Việc thăm trang web này của bạn sẽ không được ghi lại bởi các công cụ Web Analytics.";s:17:"OptOutCompleteBis";s:272:"Ghi nhớ rằng nếu bạn xóa cookies hoặc xóa cookie opt-out (quảng cáo, spam), hay nếu bạn tùy chỉnh máy tính hoặc trình duyệt của bạn, bạn sẽ phải tiến hành các thao tác opt-out (chặn spam, quảng cáo) lại một lần nữa.";s:17:"OptOutExplanation";s:318:"Matomo được sử dụng để cung cấp quyền riêng tư trên Internet. Để cung cấp cho những khách ghé thăm trang web của bạn các lựa chọn chặn Matomo Web Analytics, bạn có thể thêm vào mã HTML sau trên trang web của bạn, ví dụ tùy chỉnh trong trang Quyền Riêng tư.";s:21:"OptOutForYourVisitors";s:45:"Matomo không tham gia truy cập của bạn";s:18:"PiwikIsInstalledAt";s:33:"Matomo được cài đặt tại";s:29:"PluginSettingChangeNotAllowed";s:102:"Bạn không được phép thay đổi giá trị của các thiết lập "%1$s" trong plugin "%2$s"";s:19:"PluginSettingsIntro";s:101:"Ở đây bạn có thể thay đổi các thiết lập cho các plugin của bên thứ 3 như sau:";s:29:"PluginSettingsValueNotAllowed";s:83:"Giá trị của trường "%1$s" trong plugin "%2$s" không được chấp nhận";s:29:"SendPluginUpdateCommunication";s:45:"Gửi email khi có bản cập nhật plugin";s:33:"SendPluginUpdateCommunicationHelp";s:131:"Một email sẽ được gửi tới quản trị viên cao nhất trong hệ thống khi có sẵn phiên bản mới cho plugin.";s:14:"StableReleases";s:318:"Nếu Matomo là một phần quan trọng của công việc của bạn, chúng tôi khuyên bạn nên sử dụng phiên bản ổn định mới nhất. Nếu bạn sử dụng phiên bản beta mới nhất và bạn tìm thấy một lỗi hoặc có một đề nghị, xin vui lòng %1$s xem tại đây %2$s.";s:20:"SystemPluginSettings";s:31:"Cài đặt Plugin hệ thống";s:10:"TrackAGoal";s:27:"Theo dõi một mục tiêu";s:12:"TrackingCode";s:13:"Mã theo dõi";s:18:"TrustedHostConfirm";s:96:"Bạn có chắc rằng bạn muốn thay đổi tên máy chủ Matomo đáng tin cậy không?";s:19:"TrustedHostSettings";s:39:"Tên máy chủ Matomo đáng tin cậy";s:13:"UseCustomLogo";s:46:"Sử dụng một biểu tượng tùy chỉnh";s:18:"ValidPiwikHostname";s:33:"Tên máy chủ Matomo hợp lệ";s:19:"WithOptionalRevenue";s:27:"với doanh thu tùy chọn";s:14:"YouAreOptedOut";s:28:"Bạn đang chọn thoát ra";s:12:"YouMayOptOut";s:217:"Bạn có thể lựa chọn không sở hữu một số định danh riêng cho cookie phân tích trang web duy nhất gắn với máy tính của bạn để không bị thu thập số liệu trên website này.";s:15:"YouMayOptOutBis";s:108:"Để lựa chọn nó, xin vui lòng bấm vào dưới đây để chấp nhận một cookie từ chối.";}s:8:"CoreHome";a:34:{s:14:"CategoryNoData";s:78:"Không có dữ liệu trong mục này. Thử "tất cả các thành phần"";s:15:"CheckForUpdates";s:34:"Kiểm tra các bản cập nhật";s:13:"CheckPiwikOut";s:26:"Thủ tục thoát Matomo!";s:21:"CloseWidgetDirections";s:112:"Bạn có thể đóng widget này bằng cách click vào biểu tượng "X" ở trên cùng của các widget";s:30:"DataForThisReportHasBeenPurged";s:92:"Các dữ liệu cho báo cáo này là nhiều hơn %s tháng và đã được loại bỏ";s:29:"DataTableExcludeAggregateRows";s:39:"Hàng tổng hợp hiển thị %s Hide";s:29:"DataTableIncludeAggregateRows";s:39:"Hàng tổng hợp hiển thị %s Show";s:7:"Default";s:13:"mặc định";s:11:"DonateCall1";s:168:"Matomo sẽ luôn luôn cho bạn thấy không có gì để sử dụng, nhưng điều đó không có nghĩa là nó cho thấy chúng ta không có gì để làm.";s:11:"DonateCall2";s:91:"Matomo cần sự hỗ trợ của bạn để phát triển và phát triển mạnh hơn.";s:28:"ExcludeRowsWithLowPopulation";s:76:"Tất cả các hàng được hiển thị %s Loại trừ dân số thấp";s:12:"ExternalHelp";s:34:"Giúp đỡ (mở trong tab mới)";s:16:"FlattenDataTable";s:58:"Báo cáo này là phân cấp %s Làm cho nó minh bạch";s:28:"IncludeRowsWithLowPopulation";s:96:"Các Hàng với mật độ tập trung thấp đang ẩn %s Hiển thị tất cả các hàng";s:21:"InjectedHostEmailBody";s:123:"Xin chào, hôm nay tôi đã cố gắng để truy cập Matomo và gặp phải cảnh báo tên máy chủ chưa biết";s:24:"InjectedHostEmailSubject";s:69:"Matomo được truy cập với tên máy chủ không rõ ràng :%s";s:31:"InjectedHostNonSuperUserWarning";s:264:"%1$sNhấn vào đây để truy cập Matomo một cách an toàn%2$s và loại bỏ cảnh báo này. Bạn còn có thể liên lạc với người quản trị Matomo và thông báo cho họ về vấn đề này(%3$sNhấn vào đây để gửi email%4$s)";s:28:"InjectedHostSuperUserWarning";s:317:"Matomo có thể bị cấu hình sai (ví dụ, Matomo gần đây được dời sang máy chủ khác hoặc URL khác). Bạn có thể %1$snhấn vào đây và thêm %2$s như là tên máy chủ hợp lệ%3$s, hoặc %4$snhấn vào đây để đi đến %5$s để truy cập Matomo một cách an toàn%6$s";s:24:"InjectedHostWarningIntro";s:134:"Bây giờ bạn đang truy cập Matomo từ %1$s, nhưng Matomo đã được cấu hình để chạy tại địa chỉ này: %2$s";s:25:"NoPrivilegesAskPiwikAdmin";s:261:"Bạn được đăng nhập như \'%1$s\' nhưng dường như bạn không được phép thiết lập trong Matomo. %2$s Yêu cầu quản trị Matomo của bạn (bấm vào để email) %3$s để cung cấp cho bạn \'xem\' truy cập đến một website.";s:11:"PeriodRange";s:9:"Phạm vi";s:17:"ReportGeneratedOn";s:32:"Báo cáo được tạo vào %s";s:19:"ReportGeneratedXAgo";s:42:"Báo cáo được tạo %s trước đây";s:15:"SharePiwikShort";s:107:"Matomo! Công cụ phân tích web mã nguồn mỡ miễn phí! Sở hữu dữ liệu của chính bạn.";s:9:"ShareThis";s:22:"Chia sẻ điều này";s:10:"ShowJSCode";s:47:"Hiển thị đoạn mã JavaScript để chèn";s:32:"SubscribeAndBecomePiwikSupporter";s:133:"Thực hiện một trang thanh toán bằng thẻ tín dụng an toàn (Paypal) để trở thành một nhà tài trợ cho Matomo!";s:12:"SupportPiwik";s:18:"Ủng hộ Matomo!";s:11:"TableNoData";s:39:"Không có dữ liệu cho bảng này.";s:26:"ThereIsNoDataForThisReport";s:41:"Không có dữ liệu cho báo cáo này";s:18:"UnFlattenDataTable";s:55:"Báo cáo là rõ ràng %s Làm cho nó có thứ bậc";s:26:"ViewAllPiwikVideoTutorials";s:47:"Xem tất cả các video hướng dẫn Matomo";s:19:"WebAnalyticsReports";s:30:"Các báo cáo phân tích web";s:27:"YouAreUsingTheLatestVersion";s:63:"Bạn đang sử dụng phiên bản mới nhất của Matomo!";}s:16:"CorePluginsAdmin";a:37:{s:15:"ActionUninstall";s:16:"Gỡ cài đặt";s:8:"Activate";s:12:"Kích hoạt";s:9:"Activated";s:17:"Đã kích hoạt";s:6:"Active";s:12:"Kích hoạt";s:8:"Activity";s:14:"Hoạt động";s:14:"AuthorHomepage";s:22:"Tác giả Trang chủ";s:9:"Changelog";s:23:"Lịch sử thay đổi";s:10: