ản";s:8:"Websites";s:8:"Websites";}s:11:"CoreUpdater";a:45:{s:36:"CriticalErrorDuringTheUpgradeProcess";s:53:"Lỗi nghiêm trọng trong quá trình cập nhạt:";s:23:"DatabaseUpgradeRequired";s:32:"Nâng cấp cơ sở dữ liệu";s:22:"DownloadingUpdateFromX";s:35:"Đang download để update từ %s";s:9:"DownloadX";s:16:"Tải xuống %s";s:18:"EmptyDatabaseError";s:75:"Database %s rỗng. Bạn phải sửa hoặc xóa file cấu hình Matomo.";s:12:"ErrorDIYHelp";s:128:"Nếu bạn là người dùng thông thạo hệ thống (advanced user) và gặp phải lỗi trong quá trình cập nhật:";s:14:"ErrorDIYHelp_1";s:89:"phát hiện nguyên nhân và sửa lại (ví dụ memory_limit hay max_execution_time)";s:14:"ErrorDIYHelp_2";s:87:"thực thi các truy vấn còn lại mà không thành công trong phần cập nhật";s:14:"ErrorDIYHelp_3";s:209:"chỉnh sửa trực tiếp trên table \\"option\\" trong cơ sở dữ liệu Matomo của bạn, thiết lập giá trị của version_core thành \\"phiên bản mà bạn cập nhật không thành công\\".";s:14:"ErrorDIYHelp_4";s:136:"chạy lại phần updater (qua trình duyệt hoặc chế độ dòng lệnh) để chạy tiếp các phần chưa cập nhật xong";s:14:"ErrorDIYHelp_5";s:105:"báo cáo lỗi này (và giải pháp) để Matomo có thể trở nên tốt hơn với người dùng";s:25:"ErrorDuringPluginsUpdates";s:44:"Lỗi trong quá trình cập nhật plugin:";s:29:"ExceptionAlreadyLatestVersion";s:72:"Phiên bản %s Matomo của bạn là phiên bản cập nhật nhất.";s:21:"ExceptionArchiveEmpty";s:24:"bộ lưu trữ trống.";s:28:"ExceptionArchiveIncompatible";s:41:"Bộ Lưu trữ không tương thích: %s";s:26:"ExceptionArchiveIncomplete";s:81:"Lưu trữ không đầy đủ: một số tập tin bị thiếu (ví dụ: %s).";s:18:"HelpMessageContent";s:313:"Xem trong %1$s câu hỏi thường gặp của Matomo %2$s về các lỗi phổ biến trong quá trình cập nhật. %3$s Hãy yêu cầu người quản trị hệ thống của bạn - Họ có thể trợ giúp bạn xử lý hầu hết những lỗi liên quan đến máy chủ hoặc cấu hình MySQL.";s:32:"HelpMessageIntroductionWhenError";s:148:"Trên đây là thông báo lỗi chính. Nó sẽ giúp giải thích nguyên nhân, nhưng nếu bạn cần thêm sự giúp đỡ xin vui lòng:";s:34:"HelpMessageIntroductionWhenWarning";s:213:"Bản cập nhật đã hoàn thành, tuy nhiên có một số vấn đề trong quá trình này. Xin vui lòng đọc các mô tả ở trên để biết chi tiết. Để được sự trợ giúp tốt hơn:";s:26:"InstallingTheLatestVersion";s:43:"Đang cài đặt phiên bản mới nhất";s:19:"MajorUpdateWarning1";s:106:"Đây là phần cập nhật quan trọng! Vì vậy sẽ mất nhiều thời gian hơn bình thường.";s:19:"MajorUpdateWarning2";s:88:"Lời khuyên sau đây đặc biệt quan trọng cho việc cài đặt quy mô lớn.";s:26:"NoteForLargePiwikInstances";s:62:"Lưu ý quan trọng khi cài đặt Matomo có quy mô lớn.";s:32:"PiwikHasBeenSuccessfullyUpgraded";s:48:"Matomo vừa được cập nhật thành công!";s:24:"PiwikUpdatedSuccessfully";s:38:"Matomo đã cập nhật thành công!";s:41:"PiwikWillBeUpgradedFromVersionXToVersionY";s:106:"Cơ sở dữ liệu Matomo sẽ được nâng cấp từ phiên bản %1$s lên phiên bản mới %2$s.";s:9:"ReadyToGo";s:26:"Sẵn sàng thực hiện?";s:34:"TheFollowingPluginsWillBeUpgradedX";s:46:"Các plugin sau sẽ được cập nhật: %s";s:35:"ThereIsNewVersionAvailableForUpdate";s:54:"Có phiên bản mới của Matomo để cập nhật";s:38:"TheUpgradeProcessMayFailExecuteCommand";s:237:"Nếu bạn có database Matomo lớn, các gói cập nhật có mất rất nhiều khi chạy trên trình duyệt. Trong trường hợp này, bạn có thể tiến hành các gói cập nhật này từ chế độ dòng lệnh: %s";s:45:"TheUpgradeProcessMayTakeAWhilePleaseBePatient";s:117:"Quá trình cập nhật database có thể mất thời gian một chút, bạn vui lòng kiên nhẫn chờ đợi.";s:18:"UnpackingTheUpdate";s:35:"Đang giải nén gói cập nhật";s:19:"UpdateAutomatically";s:25:"Cập nhật tự động";s:33:"UpdateHasBeenCancelledExplanation";s:228:"Matomo One Click Update đã bị thoát. Nếu bạn không thể sửa được thông điệp lỗi ở trên, bạn có thể update Matomo bằng tay. %1$s Vui lòng xem %2$stài liệu cập nhật %3$s để bắt đầu!";s:11:"UpdateTitle";s:12:"Cập nhật";s:18:"UpdateSuccessTitle";s:48:"Matomo vừa được cập nhật thành công!";s:8:"Updating";s:18:"Đang cập nhật";s:15:"UpgradeComplete";s:18:"Cập nhật xong!";s:12:"UpgradePiwik";s:20:"Cập nhật Matomo!";s:22:"VerifyingUnpackedFiles";s:36:"Xác minh các tập tin giải nén";s:15:"WarningMessages";s:12:"Cảnh báo:";s:45:"WeAutomaticallyDeactivatedTheFollowingPlugins";s:50:"Chúng tôi tự động tắt các plugin sau: %s";s:43:"YouCanUpgradeAutomaticallyOrDownloadPackage";s:114:"Bạn có thể cập nhật tự động phiên bản %s hoặc tải về gói cập nhật và tự cài dặt.";s:23:"YourDatabaseIsOutOfDate";s:133:"Cơ sở dữ liệu Matomo của bạn đã lỗi thời, và phải được nâng cấp trước khi bạn có thể tiếp tục.";s:20:"ViewVersionChangelog";s:38:"Xem thay đổi cho phiên bản này:";}s:7:"DBStats";a:16:{s:13:"DatabaseUsage";s:38:"Cơ sở dữ liệu đang sử dụng";s:8:"DataSize";s:26:"kích thước dữ liệu";s:6:"DBSize";s:35:"Kích thước cơ sở dữ liệu";s:13:"EstimatedSize";s:32:"kích thước đã ước tính";s:9:"IndexSize";s:26:"kích thước chỉ mục";s:9:"LearnMore";s:203:"Để tìm hiểu thêm về cách Matomo xử lý dữ liệu và cách làm cho Matomo làm việc tốt với các trang web có lượng truy cập trung bình và cao, hãy xem tài liệu này: %s.";s:15:"MainDescription";s:158:"Matomo lưu trữ tất cả dữ liệu phân tích web của bạn trong một cơ sở dữ liệu MySQL. Hiện nay, bảng Matomo chiếm %s không gian.";s:16:"MetricDataByYear";s:28:"Bảng thông số theo năm";s:12:"MetricTables";s:12:"Bảng tính";s:11:"OtherTables";s:12:"Bảng khác";s:16:"ReportDataByYear";s:27:"Bảng báo cáo bởi năm";s:12:"ReportTables";s:16:"Bảng báo cáo";s:8:"RowCount";s:12:"Hàng đếm";s:5:"Table";s:6:"Bảng";s:9:"TotalSize";s:21:"Tổng kích thước";s:13:"TrackerTables";s:21:"Bộ theo dõi bảng";}s:9:"Dashboard";a:33:{s:10:"AddAWidget";s:12:"Thêm Widget";s:18:"AddPreviewedWidget";s:63:"Bấm vào đây để thêm widget vào bảng điều khiển";s:21:"ChangeDashboardLayout";s:50:"Thay đổi cách bố trí bảng điều khiển";s:19:"CopyDashboardToUser";s:53:"Sao chép bảng điều khiển người sử dụng";s:18:"CreateNewDashboard";s:34:"Tạo bảng điều khiển mới";s:9:"Dashboard";s:22:"Bảng điều khiển";s:15:"DashboardCopied";s:108:"Bảng điều khiển hiện tại đã sao chép thành công để cho người sử dụng lựa chọn.";s:26:"DashboardEmptyNotification";s:203:"Bảng điều khiển của bạn không có widget nào. Bắt đầu bằng cách thêm các widget hoặc chỉ cần cài đặt lại bảng điều khiển với lựa chọn widget mặc định.";s:13:"DashboardName";s:28:"Tên bảng điều khiển:";s:11:"DashboardOf";s:31:"Bảng điều khiển của %s";s:16:"DefaultDashboard";s:110:"Bảng điều khiển mặc định - Sử dụng các lựa chọn widget mặc định và cột bố trí.";s:19:"DeleteWidgetConfirm";s:83:"Bạn có chắc chắn rằng muốn xóa widget này từ bảng điều khiển?";s:14:"EmptyDashboard";s:76:"Bảng điều khiển trống - Chọn các widget yêu thích của bạn.";s:13:"LoadingWidget";s:40:"Đang tải widget, vui lòng đợi ...";s:15:"ManageDashboard";s:33:"Quản lý bảng điều khiển";s:8:"Maximise";s:9:"Phóng to";s:8:"Minimise";s:9:"Thu nhỏ";s:7:"NotUndo";s:55:"Bạn sẽ không thể khôi phục hành động này";s:17:"PluginDescription";s:220:"Bảng điều khiển của bạn. Có thể tùy biến bằng cách thêm widget, kéo thả hoặc thêm các trường dữ liệu. Mỗi người dùng có thể tùy biến bảng điều khiến cho riêng mình.";s:15:"RemoveDashboard";s:34:"Loại bỏ bảng điều khiển";s:22:"RemoveDashboardConfirm";s:71:"Bạn có chắc chắn muốn loại bỏ bảng điều khiển "%s"?";s:33:"RemoveDefaultDashboardNotPossible";s:69:"Các bảng điều khiển mặc định không thể bị gỡ bỏ";s:15:"RenameDashboard";s:34:"Đổi tên bảng điều khiển";s:14:"ResetDashboard";s:48:"Đặt bảng điều khiển về mặc định";s:21:"ResetDashboardConfirm";s:140:"Bạn có chắc chắn muốn thiết lập lại bố trí bảng điều khiển của bạn cho thiết lập các Widget mặc định?";s:21:"SelectDashboardLayout";s:67:"Vui lòng chọn bố trí bảng điều khiển mới của bạn";s:12:"SelectWidget";s:59:"Chọn widget để thêm vào trong bảng điều khiển";s:19:"SetAsDefaultWidgets";s:53:"Thiết lập như lựa chọn widget mặc định.";s:26:"SetAsDefaultWidgetsConfirm";s:175:"Bạn có chắc chắn muốn thiết lập các lựa chọn widget hiện tại và bố trí bảng điều khiển như mẫu bảng điều khiển mặc định không?";s:30:"SetAsDefaultWidgetsConfirmHelp";s:228:"Các lựa chọn Widget và bố trí các cột bảng điều khiển này sẽ được sử dụng khi bất kỳ người dùng tạo ra một bảng điều khiển mới, hoặc khi "%s" tính năng được sử dụng.";s:14:"TopLinkTooltip";s:35:"Xem báo cáo Web Analytics cho %s.";s:14:"WidgetNotFound";s:25:"Không tìm thấy Widget";s:13:"WidgetPreview";s:19:"Xem trước Widget";}s:13:"DevicePlugins";a:4:{s:27:"BrowserWithNoPluginsEnabled";s:49:"%1$s không có plugin nào được kích hoạt";s:25:"BrowserWithPluginsEnabled";s:40:"%1$s với plugin %2$s đã kích hoạt";s:13:"WidgetPlugins";s:26:"Các Plugin trình duyệt";s:26:"WidgetPluginsDocumentation";s:226:"Báo cáo này cho thấy các plugin trình duyệt mà khách truy cập của bạn đã kích hoạt. Thông tin này có thể là quan trọng cho việc lựa chọn cách đúng để cung cấp nội dung của bạn.";}s:16:"DevicesDetection";a:12:{s:13:"BrowserEngine";s:14:"Trình duyệt";s:26:"BrowserEngineDocumentation";s:430:"Biểu đồ này cho thấy các trình duyệt khách truy cập của bạn chia thành các họ trình duyệt. %s Thông tin quan trọng nhất đối với nhà phát triển web là loại công cụ rendering nào khách truy cập của họ đang sử dụng. Các nhãn chứa tên của các công cụ tiếp theo của trình duyệt phổ biến nhất đang sử dụng công cụ cho trong giấu ngoặc đơn.";s:13:"BrowserFamily";s:19:"Họ trình duyệt";s:8:"Browsers";s:19:"Các trình duyệt";s:14:"BrowserVersion";s:27:"Phiên bản trình duyệt";s:13:"ColumnBrowser";s:14:"Trình duyệt";s:21:"ColumnOperatingSystem";s:18:"Hệ điều hành";s:19:"dataTableLabelTypes";s:6:"Kiểu";s:21:"OperatingSystemFamily";s:29:"Hệ điều hành gia đình";s:16:"OperatingSystems";s:23:"Các hệ điều hành";s:14:"WidgetBrowsers";s:32:"Trình duyệt khách truy cập";s:34:"WidgetBrowserVersionsDocumentation";s:187:"Báo cáo này chứa thông tin về loại trình duyệt mà khách truy cập của bạn sử dụng. Mỗi phiên bản trình duyệt được liệt kê một cách riêng biệt.";}s:11:"Diagnostics";a:5:{s:15:"ConfigFileTitle";s:21:"Tập tin cấu hình";s:18:"MysqlMaxPacketSize";s:29:"Kích thước gói t