emCheckTracker";s:23:"Tình trạng theo dõi";s:22:"SystemCheckWarnDomHelp";s:104:"Bạn nên kích hoạt "dom" mở rộng (ví dụ, cài đặt gói "php-dom" và / hoặc "php-xml").";s:25:"SystemCheckWarnLibXmlHelp";s:148:"Bạn nên kích hoạt "libxml" mở rộng (ví dụ, "cài đặt gói php-libxml") vì nó là yêu cầu của các mở rộng PHP lõi khác.";s:28:"SystemCheckWarnSimpleXMLHelp";s:114:"Bạn nên kích hoạt "SimpleXML" mở rộng (ví dụ, cài đặt "php-SimpleXML" và/hoặc gói "php-xml").";s:18:"SystemCheckWarning";s:92:"Matomo sẽ làm việc bình thường nhưng một số tính năng có thể bị thiếu";s:30:"SystemCheckWinPdoAndMysqliHelp";s:108:"Trên một máy chủ Windows bạn có thể thêm các dòng sau đây vào tệp php.ini của bạn: %s";s:20:"SystemCheckWriteDirs";s:34:"Các thư mục với write access";s:24:"SystemCheckWriteDirsHelp";s:103:"Để khắc phục lỗi này trên hệ thống Linux của bạn, hãy thử gõ lệnh sau đây(s)";s:19:"SystemCheckZlibHelp";s:107:"Bạn cần phải cấu hình và xây dựng lại PHP với "zlib" hỗ trợ kích hoạt, --with-zlib.";s:6:"Tables";s:18:"Đang tạo bảng";s:20:"TablesCreatedSuccess";s:30:"Đã tạo bảng thành công";s:12:"TablesDelete";s:33:"Xóa các bảng đã tìm thấy";s:20:"TablesDeletedSuccess";s:50:"Các bảng Matomo đã được xóa thành công";s:11:"TablesFound";s:74:"Các bảng sau đây đã được tìm thấy trong cơ sở dữ liệu";s:11:"TablesReuse";s:38:"Tái sử dụng các bảng có sẵn";s:17:"TablesWarningHelp";s:194:"Bạn có thể chọn sử dụng lại các bảng cơ sở dữ liệu hiện có hoặc chọn cài đặt mới để xóa tất cả các dữ liệu hiện có trong cơ sở dữ liệu.";s:24:"TablesWithSameNamesFound";s:131:"Một số %1$s bảng trong cơ sở dữ liệu %2$s của bạn có tên giống như các bảng Matomo đang cố gắng tạo";s:7:"Welcome";s:18:"Chào mừng bạn";}s:4:"Intl";a:1115:{s:13:"Continent_afr";s:9:"Châu Phi";s:13:"Continent_amc";s:10:"Trung Mỹ";s:13:"Continent_amn";s:10:"Bắc Mỹ";s:13:"Continent_ams";s:8:"Nam Mỹ";s:13:"Continent_ant";s:9:"Nam Cực";s:13:"Continent_asi";s:8:"Châu Á";s:13:"Continent_eur";s:9:"Châu Âu";s:13:"Continent_oce";s:20:"Châu Đại Dương";